import React, { Component } from "react";
import MyTabNav from "../components/MyTabNav";

import data from "../data/data";

class App extends Component {
  constructor(props) {
    super(props);
    this.projectNames = Object.keys(data);
    this.updateNewNote = this.updateNewNote.bind(this);
  }

  updateNewNote = (newNoteName, newNoteType, currentProject) => {
    var currentProject = currentProject;
    const data = {...data, currentProject: {"type":newNoteType, "title":newNoteName}}
    // this.projectNames.push(newProject);
  }

  render() {
    return (
      <div className="container">
        <MyTabNav
          projectNames={this.projectNames}
          projectMap={data}
        />
      </div>
    );
  }
}

export default App;
